import { useLocation } from "react-router-dom";

function PaymentPage() {
  const location = useLocation();
  const { plan } = location.state;

  // Use the 'plan' variable to determine which plan was clicked
  // and render the appropriate payment details

  return (
    <div>
      <h2>Payment Page</h2>
      <p>Plan Selected: {plan}</p>
      {/* Render payment details based on the plan */}
    </div>
  );
}

export default PaymentPage;
